INSERT INTO `eb_protocol` VALUES (1, '注册协议', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center;\"><b><span>汇民助农商城注册协议<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" align=\"left\"><span>本协议是您与本网站（网址：<span lang=\"EN-US\">www.hmznsc.com</span>）就网站服务等相关事宜所订立的契约，请您仔细阅读本注册协议，您点击<span lang=\"EN-US\">\"</span>同意<span lang=\"EN-US\">\"</span>按钮后，本协议即构成对双方有约束力的法律文件。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><b><span>第<span lang=\"EN-US\">1</span>条 服务条款的确认和接纳<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">1.1</span><span>会员同意所有注册协议条款并完成注册程序，才能成为本站的正式会员（即会员）。会员确认：本协议条款是处理双方权利义务的契约，始终有效，法律另有强制性规定或双方另有特别约定的，依其规定。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">1.2</span><span>会员点击同意本协议的，即视为会员确认自己具有享受本站服务等相应的权利能力并能够承担相应的法律责任。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">1.3</span><span>本网站保留在中华人民共和国大陆地区法施行之法律允许的范围内独自决定拒绝服务、关闭会员账户、清除或编辑内容或取消订单的权利。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><b><span>第<span lang=\"EN-US\">2</span>条 会员信息<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">3.1</span><span>会员应自行诚信向本站提供注册资料，会员同意其提供的注册资料真实、准确、完整、合法有效，会员注册资料如有变动的，应及时更新其注册资料。如果会员提供的注册资料不合法、不真实、不准确、不详尽的，会员需承担因此引起的相应责任及后果。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">3.2</span><span>会员在网站进行浏览、购买，提现等活动时，涉及会员真实姓名<span lang=\"EN-US\">/</span>名称、通信地址、联系电话、账户等隐私信息的，本站将予以严格保密，除非得到会员的授权或法律另有规定，本站不会向外界披露会员隐私信息。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">3.3</span><span>会员注册成功后，将产生账户信息，您可以根据网站规定改变您的密码。会员应谨慎合理的保存、使用其会员名和密码。会员若发现任何非法使用会员账号或存在安全漏洞的情况，请立即通知网站并向公安机关报案。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">3.4</span><span>会员不得将在本站注册获得的账户借给他人使用，否则会员应承担由此产生的全部责任，并与实际使用人承担连带责任。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><b><span>第<span lang=\"EN-US\">3</span>条 会员依法言行义务<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" align=\"left\"><span>本协议依据国家相关法律法规规章制定，会员同意严格遵守以下义务：<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>（<span lang=\"EN-US\">1</span>）不得利用本站从事违法活动。</span><span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" align=\"left\"><span>（<span lang=\"EN-US\">2</span>）不得传输或发表：煽动抗拒、破坏宪法和法律、行政法规实施的言论，煽动颠覆国家政权，推翻社会主义制度的言论，煽动分裂国家、破坏国家统一的的言论，煽动民族仇恨、民族歧视、破坏民族团结的言论；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>（<span lang=\"EN-US\">3</span>）不得利用本站从事洗钱、窃取商业秘密、窃取个人信息等违法犯罪活动；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>（<span lang=\"EN-US\">4</span>）不得干扰本站的正常运转，不得侵入本站及国家计算机信息系统；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>（<span lang=\"EN-US\">5</span>）不得传输或发表任何违法犯罪的、骚扰性的、中伤他人的、辱骂性的、恐吓性的、伤害性的、庸俗的，淫秽的、不文明的等信息资料；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>（<span lang=\"EN-US\">6</span>）不得传输或发表损害国家社会公共利益和涉及国家安全的信息资料或言论；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>（<span lang=\"EN-US\">7</span>）不得教唆他人从事本条所禁止的行为；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>（<span lang=\"EN-US\">8</span>）不得利用在本站注册的账户进行牟利性经营活动；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>（<span lang=\"EN-US\">9</span>）不得发布任何侵犯他人著作权、商标权等知识产权或合法权利的内容；<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>会员应不时关注并遵守本站不时公布或修改的各类合法规则规定。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>本站保有删除站内各类不符合法律政策或不真实的信息内容而无须通知会员的权利。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>若会员未遵守以上规定的，本站有权作出独立判断并采取暂停或关闭会员帐号等措施。会员须对自己在网上的言论和行为承担法律责任。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><b><span>第<span lang=\"EN-US\">4</span>条 所有权及知识产权条款<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">8.1</span><span>会员一旦接受本协议，即表明该会员主动将其在任何时间段在本站发表的任何形式的信息内容（包括但不限于客户评价、客户咨询、各类话题文章等信息内容）的财产性权利等任何可转让的权利，如著作权财产权（包括并不限于：复制权、发行权、出租权、展览权、表演权、放映权、广播权、信息网络传播权、摄制权、改编权、翻译权、汇编权以及应当由著作权人享有的其他可转让权利），全部独家且不可撤销地转让给石嘴山范巧儿富硒农副产品贸易有限责任公司（以下简称公司）所有，会员同意公司有权就任何主体侵权而单独提起诉讼。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">8.2</span><span>本协议已经构成《中华人民共和国著作权法》第二十五条（条文序号依照<span lang=\"EN-US\">2011</span>年版著作权法确定）及相关法律规定的著作财产权等权利转让书面协议，其效力及于会员在公司网站上发布的任何受著作权法保护的作品内容，无论该等内容形成于本协议订立前还是本协议订立后。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">8.3</span><span>会员同意并已充分了解本协议的条款，承诺不将已发表于本站的信息，以任何形式发布或授权其它主体以任何方式使用（包括但限于在各类网站、媒体上使用）。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">8.4</span><span>公司是本站的所有者<span lang=\"EN-US\">,</span>拥有此网站内容及资源的著作权等合法权利<span lang=\"EN-US\">,</span>受国家法律保护<span lang=\"EN-US\">,</span>有权不时地对本协议及本站的内容进行修改，并在本站张贴，无须另行通知会员。在法律允许的最大限度范围内，公司对本协议及本站内容拥有解释权。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">8.5</span><span>除法律另有强制性规定外，未经公司明确的特别书面许可<span lang=\"EN-US\">,</span>任何单位或个人不得以任何方式非法地全部或部分复制、转载、引用、链接、抓取或以其他方式使用本站的信息内容，否则，公司有权追究其法律责任。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span lang=\"EN-US\">8.6</span><span>本站所刊登的资料信息（诸如文字、图表、标识、按钮图标、图像、声音文件片段、数字下载、数据编辑和软件），均是公司或其内容提供者的财产，受中国和国际版权法的保护。本站上所有内容的汇编是公司的排他财产，受中国和国际版权法的保护。本站上所有软件都是公司或其关联公司或其软件供应商的财产，受中国和国际版权法的保护。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><b><span>第<span lang=\"EN-US\">5</span>条 责任限制及不承诺担保<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" align=\"left\"><span>除非另有明确的书面说明<span lang=\"EN-US\">,</span>本站及其所包含的或以其它方式通过本站提供给您的全部信息、内容、材料、产品（包括软件）和服务，均是在<span lang=\"EN-US\">\"</span>按现状<span lang=\"EN-US\">\"</span>和<span lang=\"EN-US\">\"</span>按现有<span lang=\"EN-US\">\"</span>的基础上提供的。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>除非另有明确的书面说明<span lang=\"EN-US\">,</span>公司不对本站的运营及其包含在本网站上的信息、内容、材料、产品（包括软件）或服务作任何形式的、明示或默示的声明或担保（根据中华人民共和国法律另有规定的以外）。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>公司不担保本站所包含的或以其它方式通过本站提供给您的全部信息、内容、材料、产品（包括软件）和服务、其服务器或从本站发出的电子信件、信息没有病毒或其他有害成分。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><span>如因不可抗力或其它本站无法控制的原因使本站销售系统崩溃或无法正常使用导致网上交易无法完成或丢失有关的信息、记录等，公司会合理地尽力协助处理善后事宜。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><b><span>第<span lang=\"EN-US\">6</span>条 协议更新及会员关注义务<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" align=\"left\"><span>根据国家法律法规变化及网站运营需要，公司有权对本协议条款不时地进行修改，修改后的协议一旦被张贴在本站上即生效，并代替原来的协议。会员可随时登录查阅最新协议；会员有义务不时关注并阅读最新版的协议及网站公告。如会员不同意更新后的协议，可以且应立即停止接受公司网站依据本协议提供的服务；如会员继续使用本网站提供的服务的，即视为同意更新后的协议。公司建议您在使用本站之前阅读本协议及本站的公告。如果本协议中任何一条被视为废止、无效或因任何理由不可执行，该条应视为可分的且并不影响任何其余条款的有效性和可执行性。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><b><span>第<span lang=\"EN-US\">7</span>条 法律管辖和适用<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" align=\"left\"><span>本协议的订立、执行和解释及争议的解决均应适用在中华人民共和国大陆地区适用之有效法律（但不包括其冲突法规则）。\n如发生本协议与适用之法律相抵触时，则这些条款将完全按法律规定重新解释，而其它有效条款继续有效。 如缔约方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决；协商不成时，任何一方均可向有公司所在地的地区法院提起诉讼。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"left\"><b><span>第<span lang=\"EN-US\">8</span>条 其他<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" align=\"left\"><span>本协议内容中以黑体、加粗、下划线、斜体等方式显著标识的条款，请会员着重阅读。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><p class=\"MsoNormal\" align=\"left\"><span>您点击本协议下方的<span lang=\"EN-US\">\"</span>同意<span lang=\"EN-US\">\"</span>按钮即视为您完全接受本协议，在点击之前请您再次确认已知悉并完全理解本协议的全部内容。<span lang=\"EN-US\"><o:p></o:p></span></span></p>');
